import { getImageUrl } from "./user";


 export function Avatar( {person , size}){
    return(

        <div>
       <img 
        className="avatar"
        src={getImageUrl(person)}
        alt={person.name}
        width={size}
        height={size}
       />

        </div>
    );
}
